#
# 至善词库中非gb2312词库，
# 优先使用gb2312小词库，非gb2312词库由于非常用字多，作为额外词库补充使用，可由【常词/扩词】动态开关使用
#
# 遇到权重不合理的频率高的字，在wubi98_user.dict 中手动修改权重
#
#
# author: cyhfvg
# date: 2025/10/16
#
# ref: [98至善词库](https://github.com/omgredfog/98wubi)
---
name: wubi98_non_gb2312
note: "wubi98单字非gb2312码表,由至善词库中移除gb2312而来，作为额外外挂词库动态开启使用"
version: "0.1"
last_edit_time: "2025-10-16"
# 码表的排序方式: by_weight 权重，original 原始顺序
sort: by_weight

# 码表内容格式：字词 键码  权重 （中间是tab，不是空格）
columns:    # 码表格式
  - text    # 文字
  - code    # 输入码
  - weight  # 权重
  - stem
encoder:
  exclude_patterns:
    - '^z.*$'

# '#'开头的只是注释， 注释只能另起一行写，不能在词条后面写
# `##` 两个 # 开头的会被识别为分组名，其后跟的词条就是该组的内容

